import tumbOn from "../../images/smalltumb.svg";
import tumbOff from "../../images/smalltumboff.svg"

export default function FilterCheckbox(isActive) {
  return (
    <section className="filter-checkbox">{isActive ? (<img alt="" src={tumbOn} className="filter-checkbox__tumb-on"/>) : (<img img alt="" src={tumbOff} className="filter-checkbox__tumb-off"/>) }</section>
  )
}
